import React from 'react'
import container from './components/Container'
import { BrowserRouter, Routes, Route } from "react-router-dom";

function App() {
  return (
    <>

      <BrowserRouter>
      <Routes>
        <Route path="/" element={<container />} />
      </Routes>
    </BrowserRouter>
    </>

  );
}

export default App;
